    post:
      description: Create a new incident on pagerduty
      parameters:
      - description: Title of the new incident
        example: ''
        in: query
        name: Title
        required: true
        schema: {type: string}
      - description: Details of the incident
        example: ''
        in: query
        name: Incident Body
        required: true
        schema: {type: string}
      - description: ID of the escalation policy to use for the incident, will default
          to default policy if blank
        example: ''
        in: query
        name: Escalation Policy ID
        required: false
        schema: {type: string}
      - description: Service ID to use for the incident, will default to the default
          service ID if blank
        example: ''
        in: query
        name: Service ID
        required: false
        schema: {type: string}
      - description: User Email to use for creation
        example: ''
        in: query
        name: From Email
        required: true
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
